import React from "react";
import Contact from "./Contact";
import About from "./About";
import {Route, Routes} from "react-router-dom"



const App = () =>{
    return(
        <>
        
            <Routes>
            <Route exact path="/" component={<About/>} />
            <Route path="/contact" component={Contact} />

            </Routes>
        
            
        
        
            
        </>
    )

}
export default App;
